import React, { Component } from 'react';
import './App.scss';
import FeaturesTeam from './components/FeaturesTeam/FeaturesTeam';
import Form from './components/Form/Form';
import SearchSection from './components/FeaturesTeamSection/Sections/SearchSection';
import TestSection from './components/FeaturesTeamSection/Sections/TestSection';
import ContactSection from './components/FeaturesTeamSection/Sections/ContactSection';
import PubliciteSection from './components/FeaturesTeamSection/Sections/PubliciteSection';
import AccelererSection from './components/FeaturesTeamSection/Sections/AccelererSection';
import AnnonceSection from './components/FeaturesTeamSection/Sections/AnnonceSection';
import IdentiteSection from './components/FeaturesTeamSection/Sections/IdentiteSection';
import PaiementSection from './components/FeaturesTeamSection/Sections/PaiementSection';
import ConcretisationSection from './components/FeaturesTeamSection/Sections/ConcretisationSection';
import ToolsSection from './components/FeaturesTeamSection/Sections/ToolsSection';

import { BrowserRouter as Router, Route, Link } from "react-router-dom";

(function() {
  "use strict";

  function doAjax(url, method, callback, data) {
    try {
      const xhr = new XMLHttpRequest();
      xhr.open(method, url);
      xhr.setRequestHeader("Content-Type", "application/json");
      data = data ? JSON.stringify(data) : null;
      if (method.toLowerCase() === "post") {
        if (!data) throw new Error("bad call");
      }
      xhr.onload = evt =>
        callback(evt.target.response || evt.srcElement.response);
      xhr.send(data);
      // console.log(data);
    } catch (err) {
      console.log(err);
    }
  }

  function createCampaign(e) {
    //return console.log(e)
    e.preventDefault();

    //        return console.log("ici tout va bien")

    const url = "http://localhost:5000/api/v1/campaign/createCampaign";
    doAjax(
      url,
      "POST",
      res => {
        window.alert("campaign created");
        // console.log(JSON.parse(res));
        console.log("app.js/res", res);
        console.log(name);
      },
      {
        name: document.getElementById("input").value,
        ft_id: 10
      }
    );
  }

  const getCampaign = function getCompaign() {
    const url = "http://localhost:5000/api/v1/campaign/displayCampaign";
    doAjax(url, "GET", res => {
      // console.log(JSON.parse(res));
      displayCampaign(JSON.parse(res));
    });
  };

  const getQuestions = function getQuestions() {
    const url = "http://localhost:5000/api/v1/campaign/displayQuestions";
    doAjax(url, "GET", res => {
      // console.log(JSON.parse(res));
      displayQuestions(JSON.parse(res));
    });
  };

  function displayCampaign(tableau) {
    if (tableau === undefined) return;

    tableau.forEach(function(e) {
      console.log(e);
      //if (e.state === 0) {
      //  e.state = "En cours";
      //}
      e.state === 0 ? (e.state = "En cours") : (e.state = "Terminée");
      var ul = document.createElement("ul");
      var li = document.createElement("li");
      document.body.appendChild(ul);
      ul.innerHTML = "";
      li.textContent = `nom de la campagne: ${e.name} - date de la campagne: ${
        e.date
      } - statut de la campagne: ${e.state}`;
      ul.appendChild(li);
    });
  }

  function displayQuestions(tableau) {
    if (tableau === undefined) return;

    tableau.forEach(function(e) {
      console.log(e);
      var ul = document.createElement("ul");
      var li = document.createElement("li");
      document.body.appendChild(ul);
      ul.innerHTML = "";
      li.textContent = `${e.number} - ${e.wording} : ${e.url}`;
      ul.appendChild(li);
    });
  }

  function createReponse(e) {
    //return console.log(e)
    e.preventDefault();
    //        return console.log("ici tout va bien")

    const url = "http://localhost:5000/api/v1/campaign/campaign";
    const yesNo = document.getElementsByClassName("reponse"); // tableau d'élements
    let wordingValue; // si le premier bouton radio (oui) est checked alors la valeur du bouton est true sinon c'est false (non)
    if (yesNo[0].checked === true) {
      wordingValue = true;
    } else if (yesNo[1].checked === true) {
      wordingValue = false;
    }

    doAjax(
      url,
      "POST",
      res => {
        window.alert("Reponse created");
        // console.log(JSON.parse(res));
        console.log("app.js/res", res);
      },
      {
        wording: wordingValue,
        action: document.getElementById("action").value,
        campagne_id: 23,
        question_id: 1
      }
    );
  }

  // const getReponse = function getReponse() {
  //   const url = "http://localhost:5000/api/v1/campaign/campaign";
  //   doAjax(url, "GET", res => {
  //     // console.log(JSON.parse(res));
  //     displayReponse(JSON.parse(res));
  //   });
  // };

  function start() {
    let buttonCampagne = document.getElementById("button-campagne");
    let display = document.getElementById("display");
    let quest = document.getElementById("quest");
    let buttonReponse = document.getElementById("button-reponse");

    if (buttonCampagne)
      buttonCampagne.onclick = function(evt) {
        createCampaign(evt);
      };

    if (display)
      display.onclick = function() {
        getCampaign();
        displayCampaign();
      };

    if (quest)
      quest.onclick = function() {
        getQuestions();
        displayQuestions();
      };

    if (buttonReponse)
      buttonReponse.onclick = function(evt) {
        createReponse(evt);
        // getReponse();
      };
  }

  window.addEventListener("DOMContentLoaded", start);
})();


class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
        <Link to="/">
          <div className="header">
            <h2>Team Maturity Web</h2>
          </div>
        </Link>

          <Route exact path="/" render={
            (props) => 
              <div className="ftWrapper">
                  <Link to="/ContactSection">
                    <FeaturesTeam ftName="Contact" campagneName="Campagne TOTO" icon="fas fa-user" theme="orange" status="En cours" />
                  </Link>
                  <Link to="/PubliciteSection">
                    <FeaturesTeam ftName="Publicité" campagneName="Campagne Lorem" icon="fas fa-bullhorn" theme="green" status="Terminée" />
                  </Link>
                  <Link to="/AccelererSection">
                    <FeaturesTeam ftName="Accélérer" campagneName="Campagne Sit" icon="fas fa-exchange-alt" theme="pink" status="En cours" />
                  </Link>
                  <Link to="/AnnonceSection">
                    <FeaturesTeam ftName="Annonce" campagneName="Campagne Ipsum" icon="far fa-newspaper" theme="skyblue" status="Terminée" />
                  </Link>
                  <Link to="/IdentiteSection">
                    <FeaturesTeam ftName="Identité" campagneName="Campagne Sit" icon="fas fa-fingerprint" theme="purple" status="En cours" />
                  </Link>
                  <Link to="/SearchSection">
                    <FeaturesTeam ftName="Search" campagneName="Campagne Ipsum" icon="fas fa-search" theme="black" status="Terminée" />
                  </Link>
                  <Link to="/PaiementSection">
                    <FeaturesTeam ftName="Paiement" campagneName="Campagne Ipsum" icon="far fa-credit-card" theme="grey" status="Terminée" />
                  </Link>
                  <Link to="/ConcretisationSection">
                    <FeaturesTeam ftName="Concrétisation" campagneName="Campagne Sit" icon="far fa-handshake" theme="blue" status="En cours" fontSize="medium" />
                  </Link>
                  <Link to="/ToolsSection">
                    <FeaturesTeam ftName="Tools" campagneName="Campagne Ipsum" icon="fas fa-sliders-h" theme="brown" status="Terminée" />
                  </Link>
                  <Link to="/TestSection">
                    <FeaturesTeam ftName="Test" campagneName="Campagne Test" icon="fas fa-vial" theme="test" status="En cours" />
                  </Link>
               </div>
              } 
           /> 
          <Route path="/ContactSection" component={ContactSection} />
          <Route path="/PubliciteSection" component={PubliciteSection} />
          <Route path="/AccelererSection" component={AccelererSection} />
          <Route path="/AnnonceSection" component={AnnonceSection} /> 
          <Route path="/IdentiteSection" component={IdentiteSection} /> 
          <Route path="/SearchSection" component={SearchSection} />
          <Route path="/PaiementSection" component={PaiementSection} />
          <Route path="/ConcretisationSection" component={ConcretisationSection} /> 
          <Route path="/ToolsSection" component={ToolsSection} />                 
          <Route path="/TestSection" component={TestSection} /> 
          <Route path="/Form" component={Form} /> 
        </div>
      </Router>
    );
  }
}

export default App;
